        /// <param name="e">The e<see cref="EventArgs"/>.</param>
        private void frmMDI_MdiChildActivate(object sender, EventArgs e)
        {

            if (this.ActiveMdiChild == null)
                TabActiveForm.Visible = false;
            else
            {
                if (this.ActiveMdiChild.Tag == null)
                {
                    XtraTabPage tp = new XtraTabPage();
                    // if (this.ActiveMdiChild.Name != "frmReportViewer")
                    tp.Text = this.ActiveMdiChild.Text;
                    //if (this.ActiveMdiChild.Name == "frmReportViewer")
                    //    tp.Text = this.ActiveMdiChild.Tag.ToString();
                    TabActiveForm.TabPages.Add(tp);
                    tp.Tag = this.ActiveMdiChild;
                    tp.Parent = TabActiveForm;
                    TabActiveForm.SelectedTabPage = tp;
                    this.ActiveMdiChild.Tag = tp;
                    this.ActiveMdiChild.FormClosed += new FormClosedEventHandler(ActiveMdiChild_FormClosed);
                }
                if (!TabActiveForm.Visible) TabActiveForm.Visible = true;
            }
        }

