        /// <param name="e">The e<see cref="EventArgs"/>.</param>
        private void rlueLanguage_EditValueChanged(object sender, EventArgs e)
        {
            object value = (sender as LookUpEdit).EditValue;
            resourceManager = Convert.ToString(value).Equals("ar", StringComparison.OrdinalIgnoreCase) ?
                new ResourceManager("POS_Software.Globalization.Arabic", typeof(frmMDI).Assembly) :
                new ResourceManager("POS_Software.Globalization.English", typeof(frmMDI).Assembly);

            culture = CultureInfo.CreateSpecificCulture(Convert.ToString(value));
            General.resourceManager = resourceManager;
            General.culture = culture;
            SwitchLanguage();
        }

